import styled from "styled-components";
import { motion } from "framer-motion";

const NavbarTemplatesStyle = styled(motion.div)``;
const NavbarTemplates = () => {
  return (
    <NavbarTemplatesStyle>
      <motion.div
        className="dropDown"
        animate={controller}
        whileHover={{ opacity: 1 }}
      >
        {HomeNavbarDown.map((e, i) => (
          <Link to={Paths[i]} className="dropDownItem" key={i}>
            <motion.spann
              whileHover={{ color: "#f2c14e" }}
              transition={{ duration: 0.1 }}
            >
              {e}
            </motion.spann>
          </Link>
        ))}
      </motion.div>
    </NavbarTemplatesStyle>
  );
};
export default NavbarTemplates;
